	add("digestion", "{\"term\":\"digestion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027digestion\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process, in the gastrointestinal tract, by which food is converted into substances that can be utilized by the body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/international/science-and-technology/21580133-how-microbes-promote-liver-cancer-overweight-punch-gut A punch in the passage\u003dMostly, the microbiome is beneficial. It helps with \u0027\u0027digestion\u0027\u0027 and enables people to extract a lot more calories from their food than would otherwise be possible. Research over the past few years, however, has implicated it in diseases from atherosclerosis to asthma to autism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The result of this process\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The ability to use this process\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The processing of decay in organic matter assisted by microorganisms\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The assimilation and understanding of ideas\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Generation of pus; suppuration\", \"priority\":7}]}, \"synonyms\":{}}");

	add("digger", "{\"term\":\"digger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Derived from \u0027dig\u0027 * {{sense|Australian soldier}} Attributed to the considerable time that soldiers spent digging trenches during World War I.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large piece of machinery that digs holes or trenches; an excavator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A tool for digging\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Sharon Bomgaars, \u0027The Best Clubhouse Ever\u0027, %22diggers%22+-intitle:%22digger|diggers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXrg8T4miN4fcmAXR6YW0Bw\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"%22diggers%22%20-intitle%3A%22digger|diggers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 143\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The post hole \u0027\u0027digger\u0027\u0027 did look ancient. I was pretty certain myself that it hadn′t dug any holes for a long, long time\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A spade (playing card\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One who digs\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Barbara J. Wrede, \u0027Civilizing Your Puppy\u0027, %22diggers%22+-intitle:%22digger|diggers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXrg8T4miN4fcmAXR6YW0Bw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22diggers%22%20-intitle%3A%22digger|diggers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 75\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"You′ve tried the supposedly sure method of squirting the \u0027\u0027digger\u0027\u0027 with water from a hose, and that hasn′t worked.This step will discourage 99 percent of the \u0027\u0027diggers\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Gary R. Sampson, Dick Wolfsie, \u0027Dog Dilemmas: Simple Solutions to Everyday Problems\u0027, %22diggers%22+-intitle:%22digger|diggers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dHLw8T6fqAYrEmQWFy7XZBw\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"%22diggers%22%20-intitle%3A%22digger|diggers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 130\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Most retrievers are \u0027not\u0027 inveterate \u0027\u0027diggers\u0027\u0027 — that′s a trait usually reserved for other breeds like wire-haired terriers and schnauzers\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A gold miner, one who digs for gold\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1853\u0027\u0027, w:Charles Charles Dickens (editor), \u0027Household Words\u0027, Volume 21, %22diggers%22+-intitle:%22digger|diggers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dHLw8T6fqAYrEmQWFy7XZBw\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"%22diggers%22%20-intitle%3A%22digger|diggers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 64\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A successful Australian digger — successful, not merely in siftings and washings, but bearing the title, and its best credentials, of a “nuggetter” − came down from Forest Creek recently and took up his abode in a low lodging-house in Little Bourke Street, Melbourne\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"An informal nickname for a friend; \u0027used as a term of endearment\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"An Australian soldier\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Helen Gilbert, \u0027Sightlines: Race, Gender, and Nation in Contemporary Australian Theatre\u0027, %22diggers%22+soldier+-intitle:%22digger|diggers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVtU8T6ykG5HumAWknpjGBw\u0026amp;redir_esc\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"%22diggers%22%20soldier%20-intitle%3A%22digger|diggers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 191\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Costume played a key part in his differentiation from British soldiers as the \u0027\u0027Digger\u0027\u0027 uniform came to embody Australian versions of masculinity and mateship\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Jeff Doyle, Jeffrey Grey, Peter Pierce, \u0027Australia\u0027s Vietnam War\u0027, %22diggers%22+soldier+-intitle:%22digger|diggers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVtU8T6ykG5HumAWknpjGBw\u0026amp;redir_esc\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"%22diggers%22%20soldier%20-intitle%3A%22digger|diggers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page xxiii\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"For many, the congruencies of the Anzac legend and the \u0027\u0027diggers\u0027\u0027 who served in Vietnam were slight, too slight, and the legend seemed unable to accommodate them\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Lisanne Gibson, Joanna Besley, \u0027Monumental Queensland: Signposts on a Cultural Landscape\u0027, %22diggers%22+soldier+-intitle:%22digger|diggers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dB8U8T4LmMarPmAXoofS5Bw\u0026amp;redir_esc\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"%22diggers%22%20soldier%20-intitle%3A%22digger|diggers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 99\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Like many other Queensland communities, the workers from the North Ipswich Railway Workshops chose a statue of a soldier, or \u0027\u0027digger\u0027\u0027, to honour their fellow workers\", \"priority\":28}]}, \"synonyms\":{}}");

