	add("digitalis", "{\"term\":\"digitalis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Modern Latin, from Latin \u0027digitālis\u0027 (lang\u003dla) (named with reference to the German common name for the plant, \u0027fingerhut\u0027 () .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant of the genus \u0027Digitalis\u0027 (herbaceous plants of the Plantaginaceae family, including the foxglove, \u0027Digitalis purpurea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"James Moore, \u0027Gardens of the Misses Garnier\u0027 in \u0027\u00271834\u0027\u0027, \u0027The Gardener’s Magazine, and Register of Rural \u0026amp; Domestic Improvement\u0027, volume 19, [http://books.google.com/books?id\u003d0VlNAAAAYAAJ\u0026amp;pg\u003dPA210\u0026amp;dq\u003d%22digitalises%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003done_page page 210\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"11. Delphiniums and \u0027\u0027digitalises\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1836\u0027\u0027, Joseph Harrison, \u0027The Floricultural Cabinet, and Florists’ Magazine\u0027, volume 4, [http://books.google.com/books?id\u003d2B8XAAAAYAAJ\u0026amp;pg\u003dPA133\u0026amp;dq\u003d%22digitales%2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage page 133\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"At the Medico-Botanical Society on Tuesday, Dr. Morries, made some some observations on opium, \u0027\u0027digitales\u0027\u0027, conium, and hyoscyamus, and exhibited specimens of oils obtained from the latter plants\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1903\u0027\u0027, \u0027American Florist\u0027, volume 19, [http://books.google.com/books?id\u003dyRBQAAAAYAAJ\u0026amp;dq\u003d%22digitalises%2\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"search_anchor page 555\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Polemoniums of various species, aubretias, dwarf phloxes, delphiniums, \u0027\u0027digitalises\u0027\u0027, gerums, erigerons and a number of other things have bloomed a second time\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A medical extract of \u0027Digitalis purpurea\u0027 prescribed for heart failure etc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1940\u0027\u0027, \u0027Farewell, My Lovely\u0027, Penguin 2010, p. 188\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"‘You very nearly died. I had to give you \u0027\u0027digitalis\u0027\u0027 three times\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Leslie Iversen, \u0027Drugs: A Very Short Introduction\u0027, Oxford 2001, p. 25\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The ancient remedy \u0027\u0027digitalis\u0027\u0027, extracted from the foxglove plant, for example, acts by blocking sodium channels in heart muscle, preventing potentially dangerous overactivity\", \"priority\":15}]}, \"synonyms\":{}}");

