	add("diglossia", "{\"term\":\"diglossia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From the {{m|la|diglōssia}}, from the French \u0027diglossie\u0027 from the Ancient greek (to 1453) \u0027δίγλωσσος\u0027 (bilingual) + \u0027-ία\u0027 (\u0027-ia\u0027, whence the French \u0027-ie\u0027 and the English \u0027-ia\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the coexistence of two closely related native languages or dialects among a certain population, one of which is regarded to be more prestigious than the other; also, that of two unrelated language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the presence of a cleft or doubled tongue\", \"priority\":2}]}, \"synonyms\":{}}");

