	add("dignitary", "{\"term\":\"dignitary\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an important or influential person, or one of high rank or positio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Daniel Taylor, \u0027Chelsea\u0027s Branislav Ivanovic climbs highest to sink Benfica\u0027 (in \u0027The Guardian\u0027, 15 May 2013)[http://www.guardian.co.uk/football/2013/may/15/benfica-chelsea-europa-league\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was a remarkable climax to a match that ended with another of those disappearing acts from John Terry only to re-emerge, in full kit, so he could climb the steps, shake the hands of Eusébio, Michel Platini and all the other \u0027\u0027dignitaries\u0027\u0027, then help Frank Lampard to lift the trophy\", \"priority\":3}]}, \"synonyms\":{}}");

	add("dignity", "{\"term\":\"dignity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|dignitee}}, from Old french (842-ca. 1400) {{m|fro|dignite}}, from Latin {{m|la|dignitas||worthiness, merit, dignity, grandeur, authority, rank, office}}, from {{m|la|dignus||worthy, appropriate}}, from Proto-indo-european {{m|ine-pro|*deḱ-no}}, from {{m|ine-pro|*deḱ-||to take}}, same source as {{m|la|decus||honor, esteem}} and {{m|la|decet||it is fitting}}. Cognate to {{m|en|deign}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A quality or state worthy of esteem and respect.\u0026lt;!--?--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1752\u0027\u0027, \u0027\u0027, I. vii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He uttered this ... with great majesty, or, as he called it, \u0027\u0027dignity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, \u0027African Charter on Human and Peoples’ Rights\u0027, art\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Every individual shall have the right to the respect of the \u0027\u0027dignity\u0027\u0027 inherent in a human being\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Decorum, formality, stateliness.\u0026lt;!--?--\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1934\u0027\u0027, Aldous Huxley, \u0026quot;Puerto Barrios\u0026quot;, in \u0027Beyond the Mexique Bay\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Official \u0027\u0027DIGNITY\u0027\u0027 tends to increase in inverse ratio to the importance of the country in which the office is held\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"High office, rank, or station.\u0026lt;!--This is in other dictionaries, and is good.--\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1781\u0027\u0027, Edward Gibbon, \u0027The Decline and Fall of the Roman Empire\u0027, F. III. 231\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"He ... distributed the civil and military \u0027\u0027dignities\u0027\u0027 among his favourites and followers\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"And the king said, What honour and \u0027\u0027dignity\u0027\u0027 hath been done to Mordecai for this\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"One holding high rank; a dignitary\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Bible, Jude 8\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"These filthy dreamers speak evil of \u0027\u0027dignities\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Fundamental principle; axiom; maxim\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Sir Thomas Brown\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Sciences concluding from \u0027\u0027dignities\u0027\u0027, and principles known by themselves\", \"priority\":19}]}, \"synonyms\":{}}");

