	add("digression", "{\"term\":\"digression\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\", \"Latin\"], \"text\":\"From Latin {{m|la|dīgressiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A departure from the subject, course, or idea at hand; an exploration of a different or unrelated concern\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The lectures included lengthy \u0027\u0027digressions\u0027\u0027 on topics ranging from the professor\u0027s dog to the meaning of life\", \"priority\":2}]}, \"synonyms\":{}}");

